import React, { Component } from 'react';

class TopPanel extends Component {

    render() {

        return (
            <div id="top-panel" className="SidePanel-container" style={{backgroundColor: '#001537', width: '100%', height: '5em', textAlign: 'center'}}>
                <h1 className="App-title">BlueBox Demo</h1>
            </div>
        );
    }
}

export default TopPanel;
